    "descriptive only - displayed in homekit apps. Changes are only recognized after readding the bridge in the app.": {"en": "descriptive only - displayed in homekit apps. Changes are only recognized after re-adding the bridge in the app.", "de": "Nur beschreibend - Ist in der Start-Anwendungen angezeigt. Die Änderungen Werden erst nach dem erneuten Bridge-Hinzufügen in der Anwendung erfasst.", "ru": "Только описательные - отображаются в приложениях для дома. Изменения распознаются только после повторного добавления хаба в приложении.", "pt": "apenas descritivo - exibido em aplicativos do homekit. As alterações só são reconhecidas após a re-adição da ponte no aplicativo.", "nl": "beschrijvend alleen - weergegeven in homekit apps. Wijzigingen worden pas herkend nadat de brug in de app opnieuw is toegevoegd.", "fr": "descriptif seulement - affiché dans les applications homekit. Les modifications ne sont reconnues qu'après avoir rajouté le pont dans l'application.", "it": "solo descrittivo: visualizzato nelle app di homekit. Le modifiche vengono riconosciute solo dopo aver aggiunto nuovamente il bridge nell'app.", "es": "descriptivo solamente: se muestra en aplicaciones de homekit. Los cambios solo se reconocen después de volver a agregar el puente en la aplicación.", "pl": "tylko opisowe - wyświetlane w aplikacjach homekit. Zmiany są rozpoznawane dopiero po ponownym dodaniu mostu w aplikacji."},
